import React, { useEffect, useRef, useState } from "react";
import io from "socket.io-client"

const socket = io.connect("http://localhost:5000")

const Room = () => {
  const [localStream, setLocalStream] = useState(null)
  const [remoteStream, setRemoteStream] = useState(null)
  const [roomId, setRoomId] = useState("")
  const [name, setName] = useState("")
  const [joined, setJoined] = useState(false)
  const [devices, setDevices] = useState([])
  const [selectedCam, setSelectedCam] = useState("")
  const localRef = useRef()
  const remoteRef = useRef()
  const pc = useRef(new RTCPeerConnection({ iceServers: [{ urls: "stun:stun.l.google.com:19302" }] }))

  useEffect(() => {
    navigator.mediaDevices.enumerateDevices().then(devs => {
      const cams = devs.filter(device => device.kind === "videoinput")
      setDevices(cams)
      if (cams[0]) setSelectedCam(cams[0].deviceId)
    })

    socket.on("offer", async ({ sdp }) => {
      await pc.current.setRemoteDescription(new RTCSessionDescription(sdp))
      const answer = await pc.current.createAnswer()
      await pc.current.setLocalDescription(answer)
      socket.emit("answer", { sdp: answer, roomId })
    })

    socket.on("answer", async ({ sdp }) => {
      await pc.current.setRemoteDescription(new RTCSessionDescription(sdp))
    })

    socket.on("candidate", ({ candidate }) => {
      pc.current.addIceCandidate(new RTCIceCandidate(candidate))
    })

    pc.current.ontrack = e => {
      setRemoteStream(e.streams[0])
    }

    pc.current.onicecandidate = e => {
      if (e.candidate) {
        socket.emit("candidate", { candidate: e.candidate, roomId })
      }
    }
  }, [])

  const joinRoom = async () => {
    const stream = await navigator.mediaDevices.getUserMedia({ video: { deviceId: selectedCam }, audio: true })
    setLocalStream(stream)
    stream.getTracks().forEach(track => pc.current.addTrack(track, stream))
    socket.emit("join", { roomId, name })
    setJoined(true)
  }

  socket.on("joined", async ({ joined }) => {
    if (joined > 1) {
      const offer = await pc.current.createOffer()
      await pc.current.setLocalDescription(offer)
      socket.emit("offer", { sdp: offer, roomId })
    }
  })

  useEffect(() => {
    if (localRef.current && localStream) localRef.current.srcObject = localStream
    if (remoteRef.current && remoteStream) remoteRef.current.srcObject = remoteStream
  }, [localStream, remoteStream])

  return (
    <div className="p-4 text-center bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-4">Ve Meet</h1>
      {!joined ? (
        <div className="space-y-4">
          <input className="border p-2" placeholder="Your Name" value={name} onChange={e => setName(e.target.value)} />
          <input className="border p-2" placeholder="Room Code" value={roomId} onChange={e => setRoomId(e.target.value)} />
          <select
            className="border p-2"
            value={selectedCam}
            onChange={e => setSelectedCam(e.target.value)}>
            {devices.map(device => (
              <option key={device.deviceId} value={device.deviceId}>{device.label}</option>
            ))}
          </select>
          <button className="bg-blue-500 text-white px-4 py-2 rounded" onClick={joinRoom}>Join Room</button>
        </div>
      ) : (
        <div className="grid grid-cols-2 gap-4 mt-6">
          <div>
            <p className="font-semibold">You ({name})</p>
            <video className="w-full rounded" ref={localRef} autoPlay playsInline muted />
          </div>
          <div>
            <p className="font-semibold">Remote</p>
            <video className="w-full rounded" ref={remoteRef} autoPlay playsInline />
          </div>
        </div>
      )}
    </div>
  )
}

export default Room
